import React from 'react';
import PropTypes from 'prop-types';

const foodList = [
  {
    id: 1,
    name: "Sushi",
    rating: 5,
    image: "data:image/jpeg;base64,"
  }, {
    id: 2,
    name: "Bulgogi",
    rating: 4.5,
    image: "data:image/jpeg;base64,"
  }, {
    id: 3,
    name: "Jjimdak",
    rating: 4.8,
    image: "data:image/jpeg;base64,"
  }, {
    id: 4,
    name: "Ramen",
    rating: 4.0,
    image: "data:image/jpeg;base64,"
  }, {
    id: 5,
    name: "Bibimbap",
    rating: 4.3,
    image: "data:image/jpeg;base64,"
  }
];

function Food({ name, picture, rating }) {
  return (
    <div className="Food">
      <h3>- I like {name} &nbsp;&nbsp;<span>{rating}/5.0</span></h3>
      <img src={picture} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired
}

function App() {
  return (
    <div className="App">
      <h1>Foods That I Like</h1>
      {foodList.map(food => (
        <Food key={food.id} name={food.name} picture={food.image} rating={food.rating}/>
      ))}
    </div>
  );
}

export default App;